import React from "react";

import logo from "../img/logo-t10.png";

const Header = () => {
  return (
    <header>
      <div className="container">
        <h1>
          <a href="#main">
            <img src={logo} alt="Logo" />
          </a>
        </h1>
      </div>
    </header>
  );
};

export default Header;
